import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { HiOutlineUserCircle } from 'react-icons/hi'; // Importation de l'icône d'utilisateur de Tailwind CSS
import { signOut } from 'firebase/auth';
import { auth } from '../firebase-config';
import CopyrightText from '../Components/CopyrightText.jsx';
import {
  Navbar,
  Collapse,
  Typography,
  IconButton,
} from "@material-tailwind/react";
import { Bars3Icon, XMarkIcon } from "@heroicons/react/24/outline";

function HomePage() {


  const navigate = useNavigate(); // Déclaration de la fonction navigate
  const handleLogout = () => {
    signOut(auth)
      .then(() => {
        console.log('Déconnexion réussie');
        alert('Déconnexion réussie');
        navigate('/');
      })
      .catch((error) => {
        alert(error.message);
      });
  };
  function NavList() {
    return (
      <ul className="my-2 flex flex-col gap-2 lg:mb-0 lg:mt-0 lg:flex-row lg:items-center lg:gap-6">
        <Typography
          as="li"
          variant="small"
          color="blue-gray"
          className="p-1 font-medium"
        >
          <a href="#" className="flex items-center hover:text-blue-500 transition-colors">
            Pages
          </a>
        </Typography>
        <Typography
          as="li"
          variant="small"
          color="blue-gray"
          className="p-1 font-medium"
        >
          <a href="#" className="flex items-center hover:text-blue-500 transition-colors">
            Account
          </a>
        </Typography>
        <Typography
          as="li"
          variant="small"
          color="blue-gray"
          className="p-1 font-medium"
        >
          <a href="#" className="flex items-center hover:text-blue-500 transition-colors">
            Blocks
          </a>
        </Typography>
        <Typography
          as="li"
          variant="small"
          color="blue-gray"
          className="p-1 font-medium"
        >
          <a href="#" className="flex items-center hover:text-blue-500 transition-colors">
            Docs
          </a>
        </Typography>
      </ul>
    );
  }

    const [openNav, setOpenNav] = React.useState(false);

    const handleWindowResize = () =>
      window.innerWidth >= 960 && setOpenNav(false);

    React.useEffect(() => {
      window.addEventListener("resize", handleWindowResize);

      return () => {
        window.removeEventListener("resize", handleWindowResize);
      };
    }, []);

    return (
      <Navbar className="mx-auto max-w-screen-xl px-6 py-3">
        <div className="flex items-center justify-between text-blue-gray-900">
          <Typography
            as="a"
            href="#"
            variant="h6"
            className="mr-4 cursor-pointer py-1.5"
          >
            Material Tailwind
          </Typography>
          <div className="hidden lg:block">
            <NavList />
          </div>
          <IconButton
            variant="text"
            className="ml-auto h-6 w-6 text-inherit hover:bg-transparent focus:bg-transparent active:bg-transparent lg:hidden"
            ripple={false}
            onClick={() => setOpenNav(!openNav)}
          >
            {openNav ? (
              <XMarkIcon className="h-6 w-6" strokeWidth={2} />
            ) : (
              <Bars3Icon className="h-6 w-6" strokeWidth={2} />
            )}
          </IconButton>
        </div>
        <Collapse open={openNav}>
          <NavList />
        </Collapse>
      </Navbar>
    );
  return (
    <div className="min-h-screen bg-gray-100">
      {/* Barre de navigation */}
      <nav className="bg-gray-800 py-4 px-8 flex justify-between items-center">
        <div className="text-white text-xl">Goblo</div>
          <div className="flex items-center">
          <HiOutlineUserCircle className="h-6 w-6 text-white mr-2" />
          <button className="text-white">Mon compte</button>
          <button onClick={handleLogout} className="text-white ml-4">Déconnexion</button>
        </div>
      </nav>

      {/* Contenu de la page */}
      <div className="container mx-auto px-4 py-8">
        {/* Logo */}
        <div className="text-center mb-8">
          <img className="mx-auto w-20 h-20" src="/logo.png" alt="Logo de l'application" />
        </div>

        {/* Cadres */}
        <div className="grid grid-cols-2 lg:grid-cols-3 gap-4">
          {/* Cadre Enroller */}
          <Link to="/enrollment" className="border border-gray-300 p-4 rounded-lg flex items-center justify-center bg-gray-200 hover:bg-gray-300 transition duration-300">
            {/* Icône */}
            <img className="w-12 h-12" src="hommes.png" alt="Icône" />
            {/* Texte */}
            <div className="ml-2">
              <div className="font-semibold">Enroller</div>
              <div>Enregistrer les contribuables</div>
            </div>
          </Link>

          {/* Cadre Encaisser */}
          <Link to="/encaisser" className="border border-gray-300 p-4 rounded-lg flex items-center justify-center bg-gray-200 hover:bg-gray-300 transition duration-300">
            {/* Icône */}
            <img className="w-12 h-12" src="Wallet@3x.png" alt="Icône" />
            {/* Texte */}
            <div className="ml-2">
              <div className="font-semibold">Encaisser</div>
              <div>Encaisser les contribuables</div>
            </div>
          </Link>

          {/* Cadre Rapports */}
          <Link to="/reports" className="border border-gray-300 p-4 rounded-lg flex items-center justify-center bg-gray-200 hover:bg-gray-300 transition duration-300">
            {/* Icône */}
            <img className="w-12 h-12" src="Line_up@3x.png" alt="Icône" />
            {/* Texte */}
            <div className="ml-2">
              <div className="font-semibold">Rapports</div>
              <div>Consulter les rapports des contribuables</div>
            </div>
          </Link>

          {/* Cadre Comptes */}
          <Link to="/accounts" className="border border-gray-300 p-4 rounded-lg flex items-center justify-center bg-gray-200 hover:bg-gray-300 transition duration-300">
            {/* Icône */}
            <img className="w-12 h-12" src="User@3x.png" alt="Icône" />
            {/* Texte */}
            <div className="ml-2">
              <div className="font-semibold">Comptes</div>
              <div>Créer comptes utilisateurs</div>
            </div>
          </Link>

          {/* Cadre Contrôler */}
          <Link to="/control" className="border border-gray-300 p-4 rounded-lg flex items-center justify-center bg-gray-200 hover:bg-gray-300 transition duration-300">
